import Header from '../../components/main_page/header/Header';
import './admin_page.css';
import UserHomeLayout from '../../layout/UserHomeLayout';
import axios from 'axios';
import { LoadAllAdminData } from './LoadAllDataAdmin';
import React, { useState, useEffect } from 'react';
import { useDispatch } from 'react-redux';
import { setUser } from '../../action/user/userActions';
import { connect } from 'react-redux'
import { getUser } from './../../action/user/userActions';

function AdminPage(props) {
    
    useEffect()

    const user = new Promise((resolve, reject) => {
        axios.get("http://localhost:8080/admin/find/" + sessionStorage.getItem("user")).then(response => {
            resolve(response.data)
        }).catch(reject("ERROR"))
    })

    props.store.dispatch(setUser(user))
    useDispatch(setUser(user))

    return (
        <div className="">
            <Header
                type="ADMIN" />
            {/* <UserHomeLayout 
                    type="ADMIN" /> */}
        </div>
    );

}

export default connect(null, { getUser })(AdminPage);
